import React from "react";

class InputForms extends React.Component {
  render() {
    return (
      <div className="form-row">
        <form className="form">
          <input
            name="firstName"
            type="text"
            placeholder="First Name"
          />
          <input
            name="lastName"
            type="text"
            placeholder="Last Name"
          />
          <button>Submit</button>
        </form>
      </div>
    );
  }
}

export default InputForms;
